import Nav from "../components/Nav";
import Footer from "../components/Footer";
import styles from "../css/App.module.css";

function Notice() {
  return (
    <div>
      <Nav />
      <h2 className={styles.page_title}>NOTICE</h2>
      <table>
        <thead>
          <tr>
            <th>NO</th>
            <th>제목</th>
            <th>날짜</th>
            <th>조회수</th>
          </tr>
        </thead>
      </table>
      <Footer />
    </div>
  );
}
export default Notice;
